import React from 'react';
import './counter.css';


const CounterWithCustomHook = () => {
    return (
        <div>
            <h1>Counter {0}</h1>
            <hr/>

            <button className="btn btn-success mx-4">
                +1
            </button>
            <button className="btn btn-primary mx-4">
                Reset
            </button>
            <button className="btn btn-danger mx-4">
                -1
            </button>

        </div>
    );
};

export default CounterWithCustomHook;
